import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import InventoryTracking from './inventoryTracking'; // Import your InventoryTracking component
import AddProduct from './AddProduct'; // Example import for another component
import UpdateProduct from './UpdateProduct'; // Example import for another component

const App = () => {
  return (
    <Router>
      <div>
        <h1>Inventory Management System</h1>
        <Routes>
          <Route path="/" element={<InventoryTracking />} />
          <Route path="/add" element={<AddProduct />} />
          <Route path="/update/:productId" element={<UpdateProduct />} />
          {/* Define more routes as needed */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
